function Home() {
  return (
  <ul>
    <li>Apples</li>
    <li>Bananas</li>
    <li>Cherries</li>
  </ul>
  );
}


function renderApp() {
  const welcome = "Welcome!";
}

function renderLogin() {
  const please = "Please log in";
}

let authenticated = true;

if (authenticated) {
  renderApp();
} else {
  renderLogin();
}

export default Home;
